import React from 'react';

function Newtweet () {
    return (
        <form id="newTweet">
            <input
                placeholder="Title"
                required></input>
            <textarea
                placeholder="Tweet text [maximum 256 characters]"
                maxlength="256"
                required></textarea>
            <button>Post a new tweet</button>
        </form>
    );
}

export default Newtweet;
